import React, { useState } from "react";

export default function App() {
  const [query, setQuery] = useState("");

  const handleSearch = (e) => {
    e.preventDefault();
    console.log("User searched:", query);
    // Plus tard on connectera ça à l’IA
  };

  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-white text-black px-4">
      <h1 className="text-4xl font-bold mb-4">Welcome to SWAI</h1>
      <p className="text-lg text-gray-600 text-center max-w-xl mb-8">
        Shop With AI — describe your project and budget, and we’ll build a full setup for you,
        from screens to accessories. All in one click.
      </p>

      <form onSubmit={handleSearch} className="w-full max-w-md">
        <input
          type="text"
          placeholder="What do you need?"
          value={query}
          onChange={(e) => setQuery(e.target.value)}
          className="w-full px-4 py-2 border border-gray-300 rounded-full shadow-sm focus:outline-none focus:ring focus:ring-red-200"
        />
      </form>
    </div>
  );
}
